'Oh No! It's An Alien Invasion' is a Canadian animated television series which first aired on August 3, 2013, with its first season of 26 episodes. The series was created by Philippe Ivanusic-Vallee and Peter Ricq and produced by Nelvana in association with YTV.
The series was pulled from YTV's schedule on August 30, 2014. The second season premiered on Teletoon (now Cartoon Network) on November 3, 2014. The series ended on April 27, 2015, and was canceled on April 30, 2015, ending on an unresolved cliffhanger. 40 episodes were produced.
Plot
A brain-jarred alien army race, known as the Brainlings, has invaded Earth and abducted every adult at the behest of Emperor Brainlius III, who wants to throw wild parties, and his general, Briiian, who actually wants to rule the planet. A small army of kids has taken refuge inside a mall known as the "Swell-Mart" to form a Super Wicked Extreme Emergency Team (S.W.E.E.T.). Their mission is to rid Earth of the Brainlings and rescue their parents.
