Broadcast
In the United Kingdom, it premiered on May 24, 2014 on Pop and Kix (now Pop Max). It also aired on ABC3 (now ABC Entertains) in Australia. In the United States, it used to be on Netflix, until it was removed from the streaming service on May 30, 2020.
